MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "The Questa SIM graphical user interface (GUI) provides access to numerous debugging tools and windows that enable you to analyze different parts of your design. All windows initially display within the Questa SIM Main window.");
MGCAddSnippet(6, "This section describes tasks common to more than one individual window and is organized into the following categories:");
MGCAddSnippet(7, "The following tasks define actions you can take with the various windows.");
MGCAddSnippet(8, "The GUI provides features for moving and grouping the various windows.");
MGCAddSnippet(9, "Relocating a window or tab group to a new location within the Main window.");
MGCAddSnippet(10, "Removing a window from a tab group.");
MGCAddSnippet(11, "You can move a window to exist outside of the main window.");
MGCAddSnippet(12, "This section describes tasks related to column-based windows throughout the GUI.");
MGCAddSnippet(13, "You can customize the display of columns column-based windows, and then save these views for later use. ");
MGCAddSnippet(14, "You can create bookmarks that allow you to return to a specific view or place in your design for some of the windows. The bookmarks you make can be saved and automatically restored. Some of the windows that allow bookmarking include the Structure, Files, Wave, and Objects windows. ");
MGCAddSnippet(15, "The Bookmarks toolbar and the Bookmarks menu give you access to several bookmarking features.");
MGCAddSnippet(16, "You can open the Manage Bookmarks dialog box with the Manage Bookmarks toolbar button or by selecting BookmarksManage Bookmarks. ");
MGCAddSnippet(17, "On LinuxLinux is a registered trademark of Linus Torvalds in the U.S. and other countries. systems, you can capture an image of the desktop or a single window, make line drawings and take notes, then save the image for later review or to share with others. Scribble mode provides a quick way to make annotations directly on the GUI. ");
MGCAddSnippet(18, "You may need to adjust font settings to accommodate the aspect ratios of wide screen and double screen displays or to handle launching Questa SIM from an X-session. ");
MGCAddSnippet(19, "Finding and/or filtering capabilities are available for most windows. ");
MGCAddSnippet(20, "This section describes elements that are used by multiple windows.");
MGCAddSnippet(21, "Definitions of the GUI terminology used in this manual.");
MGCAddSnippet(22, "The color and shape of icons convey information about the language and type of a design object.");
MGCAddSnippet(23, "There are two basic time designations used to control display of object values in many simulator windows. ");
MGCAddSnippet(24, "The selections in the menu bar of the main window change dynamically, based on which window is currently active. As a result, some menu items change their names or become unavailable (dimmed). This section describes the menu items provided at the highest level provided for a given window. ");
MGCAddSnippet(25, "Every window has a window-specific menu that appears in the menu bar between the Add and Tools menus.");
MGCAddSnippet(26, "The File menu provides access to a number of simulation-wide options.");
MGCAddSnippet(27, "The Edit menu provides access to a number of options for manipulating information in the GUI.");
MGCAddSnippet(28, "The View menu provides to options for manipulating the GUI windows.");
MGCAddSnippet(29, "The Compile menu provides access to options related to the compile step of your simulation run.");
MGCAddSnippet(30, "The Simulate menu provides access to options related to the simulation step of your simulation run");
MGCAddSnippet(31, "The Add menu provides access to options for populating windows with data from other windows.");
MGCAddSnippet(32, "The Tools menu provides access to various tools available within the GUI.");
MGCAddSnippet(33, "The Layout menu provides access to options for manipulating the configuration of the GUI.");
MGCAddSnippet(34, "The Bookmarks menu provides access to options related to bookmarking the Wave window.");
MGCAddSnippet(35, "The Window menu provides access to options for organizing and controlling features of GUI windows.");
MGCAddSnippet(36, "The Help menu provides access to various types of documentation.");
MGCAddSnippet(37, "The Main window contains a toolbar frame that displays context-specific toolbars. The following sections describe the toolbars and their associated buttons.");
MGCAddSnippet(38, "The ATV toolbar allows you to control aspects of the Assertion Thread Viewer.");
MGCAddSnippet(39, "The Analysis (coverage) toolbar allows you to control aspects of the Code Coverage Analysis window.");
MGCAddSnippet(40, "The Bookmark toolbar allows you to manage your bookmarks of the Wave window");
MGCAddSnippet(41, "The Column Layout toolbar allows you to specify the column layout for the active window.");
MGCAddSnippet(42, "The Compile toolbar provides access to compile and simulation actions.");
MGCAddSnippet(43, "The Coverage toolbar provides tools for filtering code coverage data in the Structure and Instance Coverage windows.");
MGCAddSnippet(44, "The Dataflow toolbar provides access to various tools to use in the Dataflow window.");
MGCAddSnippet(45, "The FSM toolbar provides access to tools that control the information displayed in the FSM Viewer window.");
MGCAddSnippet(46, "The Help toolbar provides a way for you to search the HTML documentation for a specified string. The HTML documentation will be displayed in a web browser.");
MGCAddSnippet(47, "The Layout toolbar allows you to select a predefined or user-defined layout of the graphical user interface. ");
MGCAddSnippet(48, "The Memory toolbar provides access to common functions. ");
MGCAddSnippet(49, "The Mode toolbar provides access to tools for controlling the mode of mouse navigation.");
MGCAddSnippet(50, "The Objectfilter toolbar provides filtering of design objects appearing in the Objects window. ");
MGCAddSnippet(51, "The Precision toolbar allows you to control the precision of the data in the Verification Management windows (Browser, Tracker, Results Analysis).");
MGCAddSnippet(52, "The Process toolbar contains three toggle buttons (only one can be active at any time) that controls the view of the Process window.");
MGCAddSnippet(53, "The Profile toolbar provides access to tools related to the profiling windows (Ranked, Calltree, Design Unit, and Structural).");
MGCAddSnippet(54, "The Schematic toolbar provides access to tools for manipulating highlights and signals in the Dataflow and Schematic windows.");
MGCAddSnippet(55, "The Simulate toolbar provides various tools for controlling your active simulation.");
MGCAddSnippet(56, "The Source toolbar allows you to perform several activities on Source windows.");
MGCAddSnippet(57, "The Standard toolbar contains common buttons that apply to most windows.");
MGCAddSnippet(58, "The Step toolbar allows you to step through your source code.");
MGCAddSnippet(59, "The Wave toolbar allows you to perform specific actions in the Wave window.");
MGCAddSnippet(60, "The Wave Compare toolbar allows you to quickly find differences in a waveform comparison.");
MGCAddSnippet(61, "The Wave Cursor toolbar provides various tools for manipulating cursors in the Wave window.");
MGCAddSnippet(62, "The Wave Edit toolbar provides easy access to tools for modifying an editable wave.");
MGCAddSnippet(63, "The Wave Expand Time toolbar provides access to enabling and controlling wave expansion features.");
MGCAddSnippet(64, "The Zoom toolbar allows you to change the view of the Wave window.");
MGCAddSnippet(65, "The default GUI toolbar format of multiple separate toolbars can be replaced with a row of tabs containing buttons grouped into common tasks such as editing, debugging, and so forth. ");
MGCAddSnippet(66, "The Compile Toolbar Tab provides access to compile actions.");
MGCAddSnippet(67, "The Coverage toolbar tab provides tools for filtering code coverage data in the Structure and Instance Coverage windows.");
MGCAddSnippet(68, "The Debug toolbar tab provides tools for debugging in various windows.");
MGCAddSnippet(69, "The Edit toolbar tab provides tools for modifying an editable waveform.");
MGCAddSnippet(70, "The Home toolbar tab contains common buttons that apply to most windows.");
MGCAddSnippet(71, "The Layout toolbar tab allows you to select a predefined or user-defined layout of the graphical user interface. ");
MGCAddSnippet(72, "The Profile toolbar tab provides access to tools related to the profiling windows (Ranked, Calltree, Design Unit, and Structural.");
MGCAddSnippet(73, "The Schematic toolbar tab provides access to tools for manipulating highlights and signals in the Dataflow and Schematic windows.");
MGCAddSnippet(74, "The Simulate Toolbar tab allows you to control aspects of simulation including running the simulation and stepping through your code.");
MGCAddSnippet(75, "Buttons that function only in a specific window are available in a bar at the top of the window. ");
MGCAddSnippet(76, "You can customize the display of the Toolbar Tabs in the main GUI and undocked windows. ");
MGCAddSnippet(77, "You can create your own tabs and populate them with the buttons and widgets you want to use. In addition you can restore tabs you have deleted from the main GUI or an undocked window. ");
MGCAddSnippet(78, "You can add and delete buttons from any Toolbar Tab or window and add buttons to windows that do not have default buttons associated with them. ");
MGCAddSnippet(79, "The Widget Toolbox allows you to change the default layout of the Toolbar Tabs and buttons on each tab and window. ");
MGCAddSnippet(80, "The following table provides you with the toolbar tab locations of the 10.2 and earlier toolbars.");
MGCAddSnippet(81, "The following table summarizes all of the available windows.");
MGCAddSnippet(82, "Use this window to view all embedded and external assertions that were successfully compiled and simulated during the current session. ");
MGCAddSnippet(83, "Use this window to view the progress of assertion threads (PSL and SystemVerilog assertions) over time. ");
MGCAddSnippet(84, "The Call Stack window displays the current call stack when you single step the simulation, the simulation has encountered a breakpoint, or when you select any process in either the Structure or Processes windows.");
MGCAddSnippet(85, "The Capacity-Object window shows memory use based on objects, and the Capacity-Line window shows memory usage based on point of allocation. You can have both windows open at the same time to debug memory issues.");
MGCAddSnippet(86, "The Class Graph window provides a graphical view of your SystemVerilog classes, including any extensions of other classes and related methods and properties.");
MGCAddSnippet(87, "The Class Instances window shows the list of class instances and their values for a particular selected class type. You may add the class items directly to the wave or list windows, log them, or get other information about them.");
MGCAddSnippet(88, "The Class Tree window provides a hierarchical view of your SystemVerilog classes, including any extensions of other classes, related methods and properties, as well as any covergroups.");
MGCAddSnippet(89, "Use this window to view covered (executed), uncovered (missed), and/or excluded statements, branches, conditions, expressions, FSM states and transitions, as well as signals that have and have not toggled. ");
MGCAddSnippet(90, "You can view executed or missed statements, branches, conditions, expressions, or FSMs, as well as items excluded from coverage. ");
MGCAddSnippet(91, "The Cover Directives window displays a list of SystemVerilog and PSL, embedded and external, cover directives that were successfully compiled and simulated during the current simulation.");
MGCAddSnippet(92, "You can populate this window by selecting an item in one of the panes of the Code Coverage Analysis window: either Statement, Branch, Expression, Condition, FSM or Toggle. Use this window to view detailed results about coverage metrics from your simulation.");
MGCAddSnippet(93, "The Covergroups window displays SystemVerilog covergroups (cvg), coverpoints (cvp), crosses (cross) and bins (bin) in the current region (which is selected via the Structure window). ");
MGCAddSnippet(94, "Use this window to explore the  physical  connectivity of your design. You can also use it to trace events that propagate through the design; and to identify the cause of unexpected outputs.");
MGCAddSnippet(95, "This section describes tasks for using the Dataflow window.");
MGCAddSnippet(96, "When you select an object, or objects, it will be highlighted an orange color.");
MGCAddSnippet(97, "Several zoom controls are available for changing the view of the Dataflow window, including mouse strokes, toolbar icons and a mouse scroll wheel.");
MGCAddSnippet(98, "You can pan the view of the Dataflow window with the mouse or keyboard.");
MGCAddSnippet(99, "You can embed a miniature wave viewer in the Dataflow window.");
MGCAddSnippet(100, "Use this window to display the source files and their locations for the loaded simulation.");
MGCAddSnippet(101, "Use this window to view a list of finite state machines in your design.");
MGCAddSnippet(102, "Use this window to graphically analyze finite state machines in your design. ");
MGCAddSnippet(103, "This section describes tasks for using the FSM Viewer window.");
MGCAddSnippet(104, "Multiple mouse operations are defined for the FSM Viewer.");
MGCAddSnippet(105, "Certain keyboard operations are defined for the FSM Viewer.");
MGCAddSnippet(106, "Save the FSM view as an image for use in other applications.");
MGCAddSnippet(107, "Use this window to analyze coverage statistics for each instance in a flat, non-hierarchical view. You can sort data columns to be more meaningful, and not be confused by hierarchy. This window contains the same code coverage statistics columns as in the Files and Structure windows.");
MGCAddSnippet(108, "Use this window to view design libraries and compiled design units.");
MGCAddSnippet(109, "The List window displays simulation results in tabular format. Use this window to display a textual representation of waveforms, which you can configure to show events and delta events for the signals or objects you have added to the window.");
MGCAddSnippet(110, "You can perform multiple tasks using the List window.");
MGCAddSnippet(111, "You can add objects to the List window from the menu, the command line, or the button bar.");
MGCAddSnippet(112, "You can create a larger group of signals and assign a new name to this group.");
MGCAddSnippet(113, "Time markers in the List window are similar to cursors in the Wave window. Time markers tag lines in the data table so you can quickly jump back to that time. Markers are indicated by a thin box surrounding the marked line.");
MGCAddSnippet(114, "Use the List window to locate objects.");
MGCAddSnippet(115, "The search command lets you search for values of selected signals. ");
MGCAddSnippet(116, "The Expression Builder is a feature of the List Signal Search dialog box and the List trigger properties dialog box. You can use it to create a search expression that follows the GUI_expression_format. ");
MGCAddSnippet(117, "Clicking the Save button will save the expression to a Tcl variable. Once saved this variable can be used in place of the expression. For example, say you save an expression to the variable foo");
MGCAddSnippet(118, "Modify the display properties and objects of the List window to create a view that is easiest for you to use.");
MGCAddSnippet(119, "By default, all List window information is lost once you close the window. If you want to restore the windows to a previously configured layout, you must save a window format file as follows.");
MGCAddSnippet(120, "You can combine signals in the List window into buses. A bus is a collection of signals concatenated in a specific order to create a new virtual signal with a specific value. A virtual compare signal (the result of a comparison simulation) is not supported for combination with any other signal.");
MGCAddSnippet(121, "New line triggering refers to what events cause a new line of data to be added to the List window. By default Questa SIM adds a new line for any signal change including deltas within a single unit of time resolution.");
MGCAddSnippet(122, "The Waveform Compare feature allows you to compare simulation runs and display differences in the List window. For a complete discussion of the Waveform Compare feature and how differences are displayed in both the Wave and List windows.");
MGCAddSnippet(123, "Use this window to display data objects declared in the current, or local, scope of the active process. These data objects are immediately visible from the statement that will be executed next, which is denoted by a blue arrow in a Source window. The contents of the window change from one statement to the next.");
MGCAddSnippet(124, "Use this window to view the contents of a memory.");
MGCAddSnippet(125, "Use this window to view a list of all memories in your design.");
MGCAddSnippet(126, "You can save all open memory instances and their formats (for example, address radix, data radix, and so forth) by creating a DO file. ");
MGCAddSnippet(127, "By default, memories are not saved in the WLF file when you issue a  log -r /*  command. To get memories into the WLF file you will need to explicitly log them. ");
MGCAddSnippet(128, "Use this window to easily access, organize, and analyze any Note, Warning, Error or other elaboration and runtime messages written to the transcript during the simulation run.");
MGCAddSnippet(129, "You can customize exactly which messages are shown in both the Message Viewer and the Results Analysis windows using the Filter Expressions dialog box. ");
MGCAddSnippet(130, "Use this window to view the names and current values of declared data objects in the current region, as selected in the Structure window. ");
MGCAddSnippet(131, "This section describes tasks for using the Objects window.");
MGCAddSnippet(132, "You can interact with other windows from the Objects window.");
MGCAddSnippet(133, "You can set the signal radix for a selected signal or signals in the Objects window as follows.");
MGCAddSnippet(134, "You can filter the contents of the Objects window by either the Name or Value columns.");
MGCAddSnippet(135, "You can filter the contents of the Objects window by the Name column.");
MGCAddSnippet(136, "The ViewFiltermenu selection allows you to specify which signal types to display in the Objects window. Multiple options can be selected. Choose Change Filter to open the Filter Objects dialog box, where you can select port modes and object types to be displayed.");
MGCAddSnippet(137, "Toggle coverage data can be displayed in the Objects window in multiple columns, as shown in the following figure. Right-click the column title bar and select Show All Columns to make sure all Toggle coverage columns are displayed. There is a column for each transition type.");
MGCAddSnippet(138, "The Pending Exclusions window contains a list of exclusion commands that have not yet been executed.");
MGCAddSnippet(139, "Use this window to view a list of HDL and SystemC processes in one of four viewing modes. In addition, the data in this window will change as you run your simulation and processes change states or become inactive.");
MGCAddSnippet(140, "Use the profiling windows to view performance or memory profiling information about your simulation. ");
MGCAddSnippet(141, "The Schematic window provides two views of the design — a Full View, which is a structural overview of the design; and an Incremental View, which uses Click-and-Sprout actions to incrementally add to the selected net's fanout. The Incremental view displays the logical gate equivalent of the RTL portion of the design, making it easier to understand the intent of the design. ");
MGCAddSnippet(142, "The schematic window provides additional control over the amount and type of information displayed, depending on whether you are using the Incremental View or the Full View. Display options are available when the Schematic window is active.");
MGCAddSnippet(143, "The Source window allows you to view and edit source files as well as set breakpoints, and step through design files.");
MGCAddSnippet(144, "Use the Source window to view and analyze your data.");
MGCAddSnippet(145, "Questa SIM allows you to drag and drop objects from the Source window to the Wave and List windows. ");
MGCAddSnippet(146, "You can add Source window objects to other dynamically linked windows with the right-click context menu.");
MGCAddSnippet(147, "When debugging your design from within the GUI, you can change your context while analyzing your source files. ");
MGCAddSnippet(148, "The Source Window includes two columns for code coverage statistics when in Coverage View mode (vsim -coverage): Hits and BC. The coverage data presented in the Source window is calculated either  by file  or  by instance , as indicated just after the source file name. The value of these columns depends on the calculation method/mode used. ");
MGCAddSnippet(149, "With source annotation you can interactively debug your design by analyzing your source files in addition to using the Wave and Signal windows. Source annotation displays simulation values, including transitions, for each signal in your source file. ");
MGCAddSnippet(150, "The Source window contains textual connectivity information that allows you to explore the connectivity of your design though the source code. This feature is especially useful when used with source annotation turned on.");
MGCAddSnippet(151, "You can easily set file-line breakpoints in your source code.");
MGCAddSnippet(152, "Use the bp command to add a file-line breakpoint from the VSIM> prompt. ");
MGCAddSnippet(153, "You can modify (or add) a breakpoint according to the line number in a source file.");
MGCAddSnippet(154, "In dynamic class-based code, an expression can be executed by more than one object or class instance during the simulation of a design. You set a conditional breakpoint on the line in the source file that defines the expression and specifies a condition of the expression or instance you want to examine. You can write conditional breakpoints to evaluate an absolute expression or a relative expression. ");
MGCAddSnippet(155, "You can check the value or description of signals, indexes,macros, and other objects in the Source window.");
MGCAddSnippet(156, "Source window bookmarks are blue flags that mark lines in a source file. These graphical icons may ease navigation through a large source file by highlighting certain lines.");
MGCAddSnippet(157, "The Source window includes a Find function that allows you to do an incremental search for specific code. ");
MGCAddSnippet(158, "You can customize the appearance and behavior of the Source window in several ways.");
MGCAddSnippet(159, "Use this window to view the hierarchical structure of the active simulation. ");
MGCAddSnippet(160, "This section describes tasks for using the Structure window.");
MGCAddSnippet(161, "You can highlight the line of code that declares a given object in several ways.");
MGCAddSnippet(162, "You can add objects from the Structure window to the Dataflow window,Schematic window, List window, Watch window or Wave window in multiple ways.");
MGCAddSnippet(163, "To find items in the Structure window, press Ctrl-F on your keyboard with the Structure window active. This opens the Find bar at the bottom of the window. ");
MGCAddSnippet(164, "You can control the types of information available in the Structure window through the ViewFilter menu items.");
MGCAddSnippet(165, "The Structure window displays code coverage information in the Structure (sim) window for any datasets being simulated. When coverage is invoked, several columns for displaying coverage data are added to these windows. ");
MGCAddSnippet(166, "The Transaction View window displays information about a selected Questa Verification IP transaction instance.");
MGCAddSnippet(167, "The Transcript window maintains a running history of commands that are invoked and messages that occur as you work with Questa SIM. When a simulation is running, the Transcript displays a VSIM prompt, allowing you to enter command-line commands from within the graphic interface. ");
MGCAddSnippet(168, "You can perform multiple tasks in the Transcript window.");
MGCAddSnippet(169, "Variable settings determine the filename used for saving the transcript. If either PrefMain(file) in the .modelsim  file or TranscriptFile in the modelsim.ini file is set, then the transcript output is logged to the specified file. ");
MGCAddSnippet(170, "By default, all Transcript window messages are printed in blue. You may colorized Transcript messages according to severity.");
MGCAddSnippet(171, "You can disable the creation of the transcript file by using a Questa SIM command immediately after Questa SIM starts.");
MGCAddSnippet(172, "The Transcript tab includes an Find function that allows you to do an incremental search for specific text. To activate the Find bar choose EditFind from the menus or click the Find icon in the toolbar. ");
MGCAddSnippet(173, "When you start typing a command at the prompt, a dropdown box appears which lists the available commands matching what has been typed so far. You may use the Up and Down arrow keys or the mouse to select the desired command. When a unique command has been entered, the command usage is presented in the drop down box.");
MGCAddSnippet(174, "The output from the drivers and readers commands, which is displayed in the Transcript window as hypertext links, allows you to right-click to open a drop-down menu and to quickly add signals to various windows. It also includes a  View Declaration  item to open the source definition of the signal.");
MGCAddSnippet(175, "The UVM Details Window displays information about UVM objects selected in the Structure window. The data displayed depends on the hierarchy level of the selected object, and the mode of the UVM details window. Multiple instances of this window are allowed, along with the option of following or staying fixed to the current context for each window instance. UVM objects do not exist until elaboration however, the UVM details window is able to remain open for a given UVM component that might go out of existence and then reappear as a user issues a restart to 0 followed by a run command.");
MGCAddSnippet(176, "Use the Verification Management Browser window to display summary information for original test results in UCDBs, ranking files, and merged test results in a UCDB. You can also use it to has a feature for customizing and saving the organization of the tabs. It also supports features for re-running tests, generating HTML reports from test results, and executing merges and test ranking. ");
MGCAddSnippet(177, "The Verification Results Analysis window is used for viewing and sorting message and test data information. It requires a  qvman  license to view. ");
MGCAddSnippet(178, "The Verification Test Analysis window is used to perform several test and coverage analysis query functions. The functionality is also available through the command line with the coverage analyze command.");
MGCAddSnippet(179, "Use the Verification Tracker window to view and analyze test-associated merged data. The functionality is also available through the command line with the coverage analyze command. ");
MGCAddSnippet(180, "The Verification Trender window is used for analyzing coverage trends in verification. This window has a feature for user-customizable column headings. It requires a  qvman  license to view. ");
MGCAddSnippet(181, "Use the Watch window to view values for signals and variables at the current simulation time and to explore the hierarchy of object oriented designs. ");
MGCAddSnippet(182, "The Wave window, like the List window, allows you to view the results of your simulation. In the Wave window, however, you can see the results as waveforms and their values. ");
MGCAddSnippet(183, "You can manipulate the user interface with various keyboard and mouse actions.");
MGCAddSnippet(184, "You can open a dynamic list of common (predefined) and user-defined keyboard sortcuts for many Questa SIM windows by entering  Ctrl+/  on your keyboard.");
MGCAddSnippet(185, "In addition to the predefined keyboard shortcuts, you can create your own shortcuts or modify predefined keyboard shortcuts with the Keyboard Shortcuts dialog box.");
MGCAddSnippet(186, "The Keyboard Shortcuts dialog box lists all existing keyboard shortcuts. This dialog box distinguishes between shortcuts that are user-defined and shortcuts that come predefined with the Questa SIM simulator. ");
MGCAddSnippet(187, "You can create your own shortcut that is either global or that applies only to a specific window. ");
MGCAddSnippet(188, "The following mouse actions and special keystrokes can be used to edit commands in the entry region of the Main window. ");
MGCAddSnippet(189, "You can open a dynamic list of keyboard shortcuts, predetermined and user defined, for most windows by entering Ctrl-Shift-? ");
MGCAddSnippet(190, "Using the following keys when the mouse cursor is within the List window will cause the indicated actions:");
MGCAddSnippet(191, "The following mouse actions and keystrokes can be used in the Wave window.");
MGCAddSnippet(192, "The Questa SIM GUI is programmed using Tcl/Tk. The GUI is highly customizable—you can control a wide variety of display characteristics such as window size, position, color, the text of window prompts, and default output filenames. ");
MGCAddSnippet(193, "GUI customization is saved in the form of layout modes.");
MGCAddSnippet(194, "There are five predefined layout modes that the GUI will load dependent upon which part of the simulation flow you are currently in. ");
MGCAddSnippet(195, "The GUI stores your manipulations on a directory by directory basis and attempts to load a layout mode in the following order.");
MGCAddSnippet(196, "The Configure Window Layouts dialog box allows you to alter the default behavior of the GUI layouts. You can display this dialog box by selecting the LayoutConfigure menu item.");
MGCAddSnippet(197, "You can create your own custom layout mode.");
MGCAddSnippet(198, "You can assign which predefined or custom layout appears in each mode.");
MGCAddSnippet(199, "Revert a layout back to the default arrangement.");
MGCAddSnippet(200, "You can delete one of your custom-made layout modes.");
MGCAddSnippet(201, "The Window Restore Properties Dialog Box allows you to specify which windows will be restored when a layout is reloaded. ");
MGCAddSnippet(202, "Some windows allow you to configure the column layout using the Configure Column Layout dialog box. ");
MGCAddSnippet(203, "You can create Tcl processes (procs) that add user-defined buttons and menus to the main window of the Questa SIM GUI. ");
MGCAddSnippet(204, "A user definable radix is used to map bit patterns to a set of enumeration labels. ");
MGCAddSnippet(205, "You can create or modify a radix with the radix define command.");
MGCAddSnippet(206, "The Global Signal Radix feature allows you to set the radix for a selected signal or signals in the active window and in other windows where the signal appears. ");
MGCAddSnippet(207, "Fixed point types are used in VHDL and SystemC to represents non-integer numbers without using a floating point format. Questa SIM automatically recognizes VHDL sfixed and ufixeda types as well as SystemC SC_FIXED and SC_UFIXED types and displays them correctly with a fixed point format.");
MGCAddSnippet(208, "You can control various aspects of the Graphical User Interface through the use of user-controlled preferences.");
MGCAddSnippet(209, "You can set user-controlled preferences in the Questa SIM GUI with the Preferences dialog box.");
MGCAddSnippet(210, "Dialog box for controlling user-defined preferences of the Questa SIM GUI.");
MGCAddSnippet(211, "Using the MODELSIM_PREFERENCES environment variable in a Linux envrionment allows you to save GUI preferences to an alternate location.");
MGCAddSnippet(212, "The LogicStyleTable combined with the ListTranslateTable define how single bit waveforms are displayed in the Wave window. ");

